import React from 'react';
import { testimonies } from '../data/data';

export default function Testimonies() {
  return (
    <div>
      <h2>Testimonies</h2>
      <ul>
        {testimonies.map((testimony, index) => (
          <li key={index}>
            <strong>{testimony.author}</strong>: {testimony.content}
          </li>
        ))}
      </ul>
    </div>
  );
}
